import React from 'react'
import ApiPrice from './components/ApiPrice'
import ApiTicker from './components/ApiTicker'


function App() {
  return (
    <div className="App">
      <ul style = {listStyle}>
        <li>
          <ApiTicker />
        </li>

        <li>
          <ApiPrice />
        </li>
      </ul>
    </div>
  );
}

const listStyle = {
  color: "blue",
  display: "inline"
}

export default App;
